import React from "react";
import s from "../components/SearchBar.module.css"

export default function SearchBar(props) {
   return (
      <div >
         <input type='search' />
      <button className={s.button} onClick={()=>{props.onSearch(2)}}>Agregar</button>
      </div>
   );
}
